async (filter = null) => {
  try {
    let unset = {
      "created_by": 1,
      "created_on": 1,
      "id": 1,
      "is_archived": 1,
      "is_deleted": 1,
      "last_updated": 1,
      "name": 1,
      "updated_by": 1,
      "org_owner_email": 1,
      "version_control_enabled": 1
    };
    return await Server.get('organisations_search', filter == null ? {
      "is_archived": false,
      "is_deleted": false
    } : filter, unset);
  } catch (error) {
    await GlobalVariables.delay_function('200');
    await CatchError.catcherror(error, GenericSearch.data, GenericSearch.responseMeta.statusCode);
  }
}

